// Get the component display
const componentDisplay = document.getElementById('component-display');

// Get all the containers inside the component display
const containers = componentDisplay.querySelectorAll('.container');

// Map each container to an object
const containerObjects = Array.from(containers).map((container, index) => {
  return {
    id: index,
    className: container.className,
    innerHTML: container.innerHTML,
    childElementCount: container.childElementCount,
  };
});

return containerObjects;

